def remove_duplicates(nested_list):
    # Itera sobre cada lista na lista aninhada
    result = []
    for sublist in nested_list:
        # Cria uma nova lista sem duplicatas consecutivas
        new_sublist = []
        prev_item = None
        for item in sublist:
            if item != prev_item:
                new_sublist.append(item)
            prev_item = item
        result.append(new_sublist)
    return result

